                <Typewriter
                    options= {{
                        strings: ["Welcome", "Bienvenido", "Salut", "Privet", "Yōkoso"],
                        autoStart: true,
                        loop: true,
                        cursor: "_"
                    }}
                />
            </>
        );
    }
}
